# --------------------- ADD MOUSE MOVE RANDOM IMAGE ---------------------
import pyautogui
import random
import time
import math
import base64
from PIL import Image, ImageGrab
from io import BytesIO
import cv2
import numpy as np

def get_x_y_w_h_from_base64(base64_string):
    screenshot = ImageGrab.grab()
    screenshot.save('1.png')
    with open('2.png', 'wb') as file:
        file.write(base64.b64decode(base64_string))
    image = cv2.imread('1.png')
    template = cv2.imread('2.png')
    w, h = template.shape[1], template.shape[0]
    result = cv2.matchTemplate(image, template, cv2.TM_CCOEFF_NORMED)
    min_val, max_val, min_loc, max_loc = cv2.minMaxLoc(result)
    threshold = 0.8
    match_locations = np.where(result >= threshold)
    top_left = max_loc
    bottom_right = (top_left[0] + w, top_left[1] + h)
    
    # Tính tọa độ (x, y, w, h)
    x, y = top_left
    w, h = bottom_right[0] - top_left[0], bottom_right[1] - top_left[1]
    
    # Vẽ hình chữ nhật trên ảnh để hiển thị phần khớp
    cv2.rectangle(image, top_left, bottom_right, (0, 255, 0), 2)
    font = cv2.FONT_HERSHEY_SIMPLEX
    font_scale = 0.5
    font_color = (255, 255, 0)
    font_thickness = 1
    text = 'TL: ' + str(top_left) + ' BR: ' + str(bottom_right) + ' Matches: ' + str(len(match_locations[0]))
    text_size, _ = cv2.getTextSize(text, font, font_scale, font_thickness)
    text_w, text_h = text_size
    text_x = top_left[0]
    text_y = top_left[1] - 10  # Vị trí của văn bản ở trên hình chữ nhật
    cv2.putText(image, text, (text_x, text_y), font, font_scale, font_color, font_thickness, cv2.LINE_AA)
    cv2.imshow('Detected', image)
    cv2.waitKey(0)
    cv2.destroyAllWindows()
    cv2.imwrite('result.png', image)
    
    # Trả về tọa độ (x, y, w, h)
    return x, y, w, h
get_x_y_w_h_from_base64('')

# Pause for a moment before exiting
time.sleep(1)

